import {Header, SobreNos, Footer, ImageSlider} from "./Home"
import Calendar from "./Calendar"
import { SliderData } from "../../assets/ImageSlider2/SliderData"

const ChamarHome = () => {
    return(
        <>
        <ImageSlider slides={SliderData} />
        <SobreNos />
        <Calendar />
        </>
    )

}

export default ChamarHome
